      user: "garret_tullio",
      comments: 2,
    },
  ],
};

const Videos = () => {
  const videoCards = TEMPORARY_DATA.videos.map((v) => {
    return <Video title={v.title} user={v.user} comments={v.comments} />;
  });
  return <div>
    <Row xs={1} md={3} className="g-4">
        {videoCards}
    </Row>
  </div>;
};

export default Videos;
